import React, { useState } from 'react';

const DataPicker = () => {
    const [startDate, setStartDate] = useState(new Date());
    
    return (
      <div  className= "input-group input-group-sm">
        <input className= "from-control" type="search"/>
      </div>
    );
}

export default DataPicker;
